First of all you need to create a dummy tileset in the tileset repository and receiving folder in your game. Create a my_mod folder under CDDA-Tilesets\gfx (tilesets repository) Create a my_mod folder under Cataclysm\gfx (your game folder) Now you need to create some files in repository. Go to CDDA-Tilesets\gfx\my_mod\ and create tileset.txt and add the following content: #my_mod NAME: my_mod_name
VIEW: my_mod_view
JSON: tile_config.json
TILESET: tiles.png As you can see name and view should be somehow related to your mod name, but actually they can be abything but existing tilesets names. Copy fallback.png from any other existing tileset into your CDDA-Tilesets\gfx\my_mod\ folder. It is needed only to be checked once and you will delete it later. Lets assume that you have a number of sprites and sprites size are: x=32 and y=48. Put all of them into the folder and name this folder: pngs_my_mod_sprites_32x48. Now you need to create the final file: tile_info.json with following content: [ { "pixelscale": 1, "width": 1, "height": 1 }, { "my_mod_sprites.png": { "sprite_width": 32, "sprite_height": 48 } }
]

88.body:
Resulting tile_config.json supposed to be for a full tileset, so you need to fix it first. Open it in any text editor, copy all content and past it here: CDDA json linter and press "LINT" button below. Now this file content can be easily readable. You will get something like this: { "tile_info": [ ... ], "tiles-new": [ { "file": "my_mod_sprites.png", "//": "range from 1 to X", "sprite_width": 32, "sprite_height": 48, "sprite_offset_x": 0, "sprite_offset_y": 0, "tiles": [ ... ] }, { "file": "fallback.png", "tiles": [], "ascii": [ ... ] } ]
} You need to do the following: Remove tile_info section. Instead add the following content before tiles-new section: "type": "mod_tileset", "compatibility": [ "Chibi_Ultica", "MShockXottoPlus" ], Remove comma between my_mod_sprites and fallback sections. Remove fallback section. Tileset will handle fallbacks. Wrap all text into square brackets [ ]. Fix offset values. In our demostration case sprite_offset_y will be -16. Be sure to include right tileset names into compatibility. You will get something like this: [ { "type": "mod_tileset", "compatibility": [ "Chibi_Ultica", "MShockXottoPlus" ], "tiles-new": [ { "file": "my_mod_sprites.png", "//": "range from 1 to X", "sprite_width": 32, "sprite_height": 48, "sprite_offset_x": 0, "sprite_offset_y": -16, "tiles": [ ... ] } ] }
] Now you can use your mod tilesheet.
